import React from "react";
import Collapsible from "react-collapsible";
import "./eventPanel.css";

const EventPanel = ({ eventDetails }) => {
  const dateMap = {
    "01": "January",
    "02": "February",
    "03": "March",
    "04": "April",
    "05": "May",
    "06": "June",
    "07": "July",
    "08": "August",
    "09": "September",
    "10": "October",
    "11": "November",
    "12": "December"
  };

  const date = eventDetails.date;
  const month = date.substring(0, 2);
  const day = date.substring(3, 5);
  const year = date.substring(6);

  const triggerElement = (
    <>
      <div className="date">
        <span className="binds"></span>
        <span className="month">{dateMap.date.substring(0, 2)}</span>
        {/* fill in event details with object values */}
        <h1 className="day">28</h1>
      </div>
      <p className="eventTitle">{eventDetails.title}</p>
    </>
  );
  return (
    <Collapsible trigger={triggerElement} triggerTagName="div">
      <p>
        This is the collapsible content. It can be any element or React
        component you like.
      </p>
      <p>
        It can even be another Collapsible component. Check out the next
        section!
      </p>
    </Collapsible>
  );
};

export default EventPanel;
